    public static void secondMethod(int n) {
        if (n == 15) {
            for (int i = 0; i < string.length() - n + 1; i++) {
                System.out.println(string.substring(i, i + n));
            }
            return;
        }
        StringBuilder sb = new StringBuilder();
        sb.append("0".repeat(n));
        int end = 1 << n;
        for (int i = 1; i < end; i++ ) {
            if (sb.indexOf(sb.substring(i) + '1') > 0) {
                sb.append('0');
            } else {
                sb.append('1');
            }
        }
        for (int i = 0; i < sb.length() - n + 1; i++) {
            System.out.println(sb.substring(i, i + n));
        }
    }

